import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../styles.css';
import '../pfm.css';

const Goals = () => {
  const [goals, setGoals] = useState([]);
  const [form, setForm] = useState({
    name: '',
    targetAmount: '',
    savedAmount: '',
    description: '',
    deadline: '',
  });
  const [editingGoal, setEditingGoal] = useState(null);

  // Fetch goals from backend
  useEffect(() => {
    const fetchGoals = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/goals');
        setGoals(response.data);
      } catch (error) {
        console.error('Error fetching goals:', error);
      }
    };

    fetchGoals();
  }, []);

  // Handle form changes
  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm((prevForm) => ({ ...prevForm, [name]: value }));
  };

  // Handle form submission (Create or Update)
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      if (editingGoal) {
        // Update goal
        const response = await axios.put(`http://localhost:5000/api/goals/${editingGoal._id}`, form);
        setGoals((prevGoals) =>
          prevGoals.map((goal) => (goal._id === editingGoal._id ? response.data : goal))
        );
        setEditingGoal(null);
      } else {
        // Create new goal
        const response = await axios.post('http://localhost:5000/api/goals', form);
        setGoals((prevGoals) => [...prevGoals, response.data]);
      }
      setForm({
        name: '',
        targetAmount: '',
        savedAmount: '',
        description: '',
        deadline: '',
      });
    } catch (error) {
      console.error('Error saving goal:', error);
    }
  };

  // Handle delete goal
  const handleDelete = async (id) => {
    try {
      await axios.delete(`http://localhost:5000/api/goals/${id}`);
      setGoals((prevGoals) => prevGoals.filter((goal) => goal._id !== id));
    } catch (error) {
      console.error('Error deleting goal:', error);
    }
  };

  
  const handleEdit = (goal) => {
    console.log('Editing goal:', goal); // Debug: Log the selected goal
    setEditingGoal(goal);
    setForm({
      name: goal.name,
      targetAmount: goal.targetAmount,
      savedAmount: goal.savedAmount,
      description: goal.description,
      deadline: goal.deadline.split('T')[0],
    });
  };
  
  return (
    <div className="app">
      <header className="header">
        <h1>Goals</h1>
      </header>
      <div className="main-content">
        <div className="content">
          <ul>
            {goals.map((goal) => (
              <li key={goal._id} className="register-container">
                <h2>{goal.name}</h2>
                <p><strong>Target Amount:</strong> ${goal.targetAmount}</p>
                <p><strong>Saved Amount:</strong> ${goal.savedAmount}</p>
                <p><strong>Description:</strong> {goal.description || 'No description'}</p>
                <p><strong>Deadline:</strong> {new Date(goal.deadline).toLocaleDateString()}</p>
                <button onClick={() => handleEdit(goal)} className="submit-btn">Edit</button>
                <button onClick={() => handleDelete(goal._id)} className="submit-btn">Delete</button>
              </li>
            ))}
          </ul>
          <form onSubmit={handleSubmit} className="register-form">
            <h2>{editingGoal ? 'Edit Goal' : 'Create New Goal'}</h2>
            <div className="form-group">
              <label>Name:</label>
              <input
                type="text"
                name="name"
                value={form.name}
                onChange={handleChange}
                required
              />
            </div>
            <div className="form-group">
              <label>Target Amount:</label>
              <input
                type="number"
                name="targetAmount"
                value={form.targetAmount}
                onChange={handleChange}
                required
              />
            </div>
            <div className="form-group">
              <label>Saved Amount:</label>
              <input
                type="number"
                name="savedAmount"
                value={form.savedAmount}
                onChange={handleChange}
              />
            </div>
            <div className="form-group">
              <label>Description:</label>
              <textarea
                name="description"
                value={form.description}
                onChange={handleChange}
              ></textarea>
            </div>
            <div className="form-group">
              <label>Deadline:</label>
              <input
                type="date"
                name="deadline"
                value={form.deadline}
                onChange={handleChange}
                required
              />
            </div>
            <button type="submit" className="submit-btn">
              {editingGoal ? 'Update Goal' : 'Create Goal'}
            </button>
          </form>
        </div>
      </div>
      <footer className="footer">
        <p>&copy; 2024 Your Company</p>
      </footer>
    </div>
  );
};

export default Goals;
